import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "../src/styling/home.css";
import NavigationBar from "./components/NavigationBar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/home";
import GiftCard from "./components/GiftCard";
import LogInPage from "./components/LogInPage";
import SignIn from "./components/LogIn";
import UserPage from "./components/UserPage";
import "react-circular-progressbar/dist/styles.css";
import Organizer from "./components/Organizer";
import TournamentOverview from "./components/TournamentOverview";
import BackOffice from "./components/BackOffice";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        {/* <NavigationBar /> */}
        <Routes>
          <Route element={<Home />} path="/" />
          <Route element={<GiftCard />} path="/giftcard" />
          <Route element={<LogInPage />} path="/sign-up" />
          <Route element={<SignIn />} path="/sign-in" />
          <Route element={<UserPage />} path="/user-page" />
          {/* <Route element={<Organizer />} path="/projects" /> */}
        </Routes>
      </BrowserRouter>
      <BrowserRouter>
        <BackOffice />
        <Routes>
          <Route element={<TournamentOverview />} path="/projects/overview" />
          <Route element={<Organizer />} path="/backoffice-projects/" />

          <Route element={<SignIn />} path="/sign-in" />
          <Route element={<UserPage />} path="/user-page" />
          <Route element={<Organizer />} path="/projects" />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
